CREATE DATABASE mangareaderdb;
USE mangareaderdb;

CREATE TABLE `chapter_data`(
    id BIGINT(20),
    title varchar(255), 
    optional varchar(255), 
    mangaid BIGINT(20),
    pageurls varchar(1000), 
    views BIGINT(20),
    uploaddate DATE,
    uploadtime TIME,
    uploaderid BIGINT(20)
)

CREATE TABLE `favorite_data`(
    id BIGINT(20),
    user_id BIGINT(20),
    manga_id BIGINT(20)
)

CREATE TABLE `genre_data`(
    id BIGINT(20),
    genre varchar(13), 
)

CREATE TABLE `manga_data`(
    id BIGINT(20),
    title varchar(255), 
    thumbnailurl varchar(1000), 
    author varchar(255), 
    summary varchar(255), 
)
CREATE TABLE `manga_genres_data`(
    id BIGINT(20),
    manga_id BIGINT(20),
    genre_id BIGINT(20)
)
CREATE TABLE `role_data`(
    `id` BIGINT(20),
    `name` varchar(255), 
)
CREATE TABLE `users_data`(
    id BIGINT(20),
    avatar varchar(3000) DEFAULT NULL,
    fullname varchar(255), 
    email varchar(255), 
    username varchar(255), 
    `password` varchar(255), 
    role_id BIGINT(20)
)

